INSERT INTO `blooming_question` VALUES (364,'Scegli l\'affermazione vera, indicando solo il numero corrispondente.<br />I numeri relativi:<ol><li>sono preceduti dal segno più</li><li>non sono preceduti da alcun segno</li><li>sono preceduti dal segno più o dal segno meno</li></ol>',NULL,'popen',51),(365,'Scegli l\'affermazione vera, indicando solo il numero corrispondente.<br />L\'insieme $\\mathbb{Q}^+$ contiene:<ol><li>tutti gli elementi di $\\mathbb{Z}$</li><li>tutti i numeri interi e razionali</li><li>tutti i numeri assoluti interi e razionali</li></ol>',NULL,'popen',51),(366,'Stabilisci se le seguente affermazione è vera o falsa. Scrivi esattamente \'vero\' oppure \'falso\'.<br />I numeri relativi servono per misurare grandezze orientate.',NULL,'popen',51),(367,'Stabilisci se le seguente affermazione è vera o falsa. Scrivi esattamente \'vero\' oppure \'falso\'.<br />$\\mathbb{R}$ è un sottoinsieme di $\\mathbb{R}^+$.',NULL,'popen',51),(368,'Stabilisci se la seguente affermazione è vera o falsa. Inserisci sono la parola \"vero\" oppure \"falso\".<br />Il valore assoluto di un numero si ottiene sopprimendo il suo segno.',NULL,'popen',51),(369,'Stabilisci se la seguente affermazione è vera. Inserisci soltanto la parola \"vero\" oppure \"falso\".<br />L\'insieme $\\mathbb{N}$ è un sottoinsieme di $\\mathbb{Q}^+$.',NULL,'popen',51),(370,'Stabilisci se la seguente affermazione è vera. Inserisci soltanto la parola \"vero\" oppure \"falso\".<br />L\'insieme $\\mathbb{N}$ è un sottoinsieme di $\\mathbb{Z}$.',NULL,'popen',51),(371,'Stabilisci se la seguente affermazione è vera. Inserisci soltanto la parola \"vero\" oppure \"falso\".<br />L\'insieme $\\mathbb{Z}$ è un sottoinsieme di $\\mathbb{Q}^+$.',NULL,'popen',51),(372,'Completa la seguente frase, inserendo la parola mancante.<br />Una grandezza che presenta due stati o versi viene chiamata <strong>grandezza ...</strong>.',NULL,'popen',51),(373,'Il numero $-4$ è un numero ...',NULL,'popen',51),(374,'Il numero $+5$ è un numero ...',NULL,'popen',51),(375,'I numeri dotati di segno sono chiamati ...',NULL,'popen',51),(376,'Indica solo il numero della risposta corretta.<br />Come si indica l\'insieme dei numeri interi relativi?<ol><li>$\\mathbb{R}$</li><li>$\\mathbb{N}$</li><li>$\\mathbb{Z}$</li><li>$\\mathbb{Q}^+$</li></ol>',NULL,'popen',51),(377,'Indica il numero della risposta corretta.<br />Due numeri sono concordi se:<ol><li>hanno lo stesso valore assoluto</li><li>hanno lo stesso segno</li><li>ambedue sono preceduti dal segno più</li></ol>',NULL,'popen',51),(378,'Indica se il seguente enunciato è \"vero\" o \"falso\".<br />Il valore assoluto di un numero relativo coincide con quello del suo opposto.',NULL,'popen',51),(379,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Due numeri relativi non nulli opposti sono sempre discordi.',NULL,'popen',51),(380,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Due numeri relativi discordi sono anche opposti.',NULL,'popen',51),(381,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Se due numeri relativi sono discordi, i loro opposti sono concordi.',NULL,'popen',51),(382,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Se due numeri relativi sono concordi i loro opposti sono discordi.',NULL,'popen',51),(383,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Due numeri con segno diverso si dicono opposti.',NULL,'popen',51),(384,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />I numeri $+9$ e $+\\frac{1}{9}$ sono concordi.',NULL,'popen',51),(385,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Nella rappresentazione grafica dei numeri relativi, a due numeri concordi corrispondono punti situati dalla medesima parte rispetto all\'origine.',NULL,'popen',52),(386,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Due numeri discordi, su una retta orientata hanno come immagini due punti situati da parti opposte rispetto all\'origine.',NULL,'popen',52),(387,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Vale la disuguaglianza $-10 \\lt -6$',NULL,'popen',52),(388,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Vale la disuguaglianza $-8 \\gt -10$.',NULL,'popen',52),(389,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Vale la disuguaglianza $-6 \\lt -8$.',NULL,'popen',52),(390,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Vale la disuguaglianza $+4 \\gt +2$.',NULL,'popen',52),(391,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Vale la disuguaglianza $+6 \\gt +8$.',NULL,'popen',52),(392,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Vale la disuguaglianza $-3 \\lt +5$.',NULL,'popen',52),(393,'Indica se il seguente enunciato è \"vero\" oppure \"falso\"<br />Vale la disuguaglianza $-8 \\lt +2$.',NULL,'popen',52),(394,'Inserisci il numero corrispondente alla risposta corretta.<br />È vera la seguente affermazione: <ol><li>$-\\frac{1}{2} \\lt +\\frac{1}{2}$</li><li>$-\\frac{1}{2} = + \\frac{1}{2}$</li><li>$-\\frac{1}{2} \\gt +\\frac{1}{2}$</li></ol>',NULL,'popen',52),(395,'Inserisci il numero corrispondente alla risposta corretta.<br />È vera la seguente affermazione:<ol><li>$-4 \\lt +\\frac{1}{4}$</li><li>$-4 = +\\frac{1}{4}$</li><li>$-4 \\gt +\\frac{1}{4}$</li></ol>',NULL,'popen',52),(396,'Inserisci il numero corrispondente alla risposta corretta.<br />I numeri $-3$ e $+4$ sono <ol><li>concordi e positivi</li><li>concordi e negativi</li><li>discordi (ma non opposti)</li><li>opposti</li></ol>',NULL,'popen',52),(397,'Inserisci il numero corrispondente alla risposta corretta.<br />I numeri $-5$ e $-5$ sono <ol><li>concordi e positivi</li><li>concordi e negativi</li><li>discordi (ma non opposti)</li><li>opposti</li></ol>',NULL,'popen',52),(398,'Inserisci il numero corrispondente alla risposta corretta.<br />I numeri $+6$ e $+0.6$ sono <ol><li>concordi e positivi</li><li>concordi e